  $templateCache.put('faq/index.html',
    "<div id=\"faq\" ng-show=\"isLoaded\"><header id=\"header\" class=\"row btc-row\"><div ng-include=\"\" onload=\"isLoaded = true\" src=\"'layout/header-logo.html'\"></div><div class=\"col-xs-12\"><h1>General FAQ</h1></div></header><div id=\"faq-content\" class=\"light-on-dark\"><div class=\"container\"><div class=\"row btc-row\"><div id=\"faq-content-inner\" class=\"col-xs-12\"><h3 id=\"intro\">Intro</h3>\n" +
    "<p>Bitcamp is a place where you combine what you’re passionate about with\n" +
    "technology. We value participant experience and mentorship over\n" +
    "competitiveness and points. Bitcamp is a place where you come to have fun\n" +
    "with your friends, learn something new, eat s’mores and have a generally\n" +
    "awesome time. We have all sorts of crazy activities planned for\n" +
    "you . . . you’ll have to come to find out the rest!</p>\n" +
    "<h3 id=\"what-s-a-hackathon-\">What&#39;s a hackathon?</h3>\n" +
    "<p>A hackathon is a creative coding marathon. Students are encouraged to come\n" +
    "with an idea, form teams, and then build out that idea into a product in\n" +
    "36 hours. For Bitcamp, we want you to take something you love (sports!\n" +
    "art! camping!) and combine it with technology to make something awesome.\n" +
    "It is a great time to push the envelope and learn some new skills.</p>\n" +
    "<h3 id=\"guidelines\">Guidelines</h3>\n" +
    "<p>Don’t bring any firearms, knives, weapons, drugs or alcohol. Don’t use an\n" +
    "old project. Start something new instead!</p>\n" +
    "<h3 id=\"travel\">Travel</h3>\n" +
    "<p>We’ll have buses covering travel from several schools. If there isn’t a\n" +
    "bus from your school or area, we’ll be providing reimbursements on an\n" +
    "application basis. We cannot reimburse anyone traveling from a school that\n" +
    "has a bus.</p>\n" +
    "<h3 id=\"timing\">Timing</h3>\n" +
    "<p>People will arrive between 5pm and 7pm on Friday, April 4, 2014.\n" +
    "Hacking will start at 9pm on Friday and go until 9am on Sunday,\n" +
    "April 6, 2014.  Closing session will end by 3pm on Sunday.</p>\n" +
    "<h3 id=\"packing-list\">Packing List</h3>\n" +
    "<p>Bring yourself, a photo ID, your signed waiver (if applicable), clothes,\n" +
    "toiletries, a sleeping bag/blanket, your hacker setup and maybe an idea or\n" +
    "two.</p>\n" +
    "<h3 id=\"registration-process\">Registration Process</h3>\n" +
    "<p>First, you sign the “permission slip” with your name, school, and email.\n" +
    "Later, we will follow up with you with travel reimbursements, liability\n" +
    "waivers, resumes, and the sort.</p>\n" +
    "<h3 id=\"teams\">Teams</h3>\n" +
    "<p>Projects are submitted by teams. You don’t need to finalize your team\n" +
    "until project submissions are due during the event. Teams are limited to\n" +
    "four people. You may have a one-person team.</p>\n" +
    "<h3 id=\"high-schoolers\">High Schoolers</h3>\n" +
    "<p>High schoolers will be admitted on a case-by-case basis. If you are a high\n" +
    "schooler and are under 18, you will need to sign a special permission\n" +
    "slip. Rules are rules.</p>\n" +
    "<h3 id=\"experience-ideas\">Experience + Ideas</h3>\n" +
    "<p>Don’t be afraid if you don’t think you have enough experience, a team or\n" +
    "an idea. A hackathon is meant for learning and in addition we will help\n" +
    "you out. We are going to have great mentors to help you out with 3D\n" +
    "printing, web development, android, iOS, and everything in between. We\n" +
    "will have workshops on all kinds of skills and even a workshop to help you\n" +
    "come up with an idea for the weekend.</p>\n" +
    "</div><div class=\"col-xs-12\"><h5 id=\"if-you-have-more-questions-feel-free-to-email-us-at-hello-bitca-mp-hello-\">If you have more questions, feel free to email us at <a href=\"mailto:hello@bitca.mp\" title=\"Send us an email!\">hello@bitca.mp</a>!</h5>\n" +
    "</div></div></div></div></div>"
  );


  $templateCache.put('faq/sponsors.html',
    "<div id=\"faq\" ng-show=\"isLoaded\"><header id=\"header\" class=\"row btc-row\"><div ng-include=\"\" onload=\"isLoaded = true\" src=\"'layout/header-logo.html'\"></div><div class=\"col-xs-12\"><h1>Sponsor FAQ</h1></div><div class=\"col-xs-12\"><h3>Reach us at <a href=\"mailto:sponsorship@bitca.mp\" target=\"_blank\">sponsorship@bitca.mp</a>.</h3></div><div class=\"col-xs-12\"><div class=\"spacer1\"></div><div class=\"spacer2\"></div></div></header><div id=\"faq-content\" class=\"light-on-dark\"><div class=\"container\"><div class=\"row btc-row\"><div id=\"faq-content-inner\" class=\"col-xs-12\"><h3 id=\"deadlines\">Deadlines</h3>\n" +
    "<h4 id=\"feb-21-\">Feb. 21:</h4>\n" +
    "<p>Funds due via the invoice sent to you by the University. Please use\n" +
    "invoice provided for tracking purposes; all checks must be made payable\n" +
    "to UMCPF.</p>\n" +
    "<h4 id=\"mar-1-\">Mar. 1:</h4>\n" +
    "<p>Logistics due for company attendees and prize descriptions.</p>\n" +
    "<h4 id=\"mar-5-\">Mar. 5:</h4>\n" +
    "<p>Committed funds cannot be refunded beyond this point.</p>\n" +
    "<h3 id=\"bitcamp-theme\">Bitcamp Theme</h3>\n" +
    "<p>There is no restrictive theme on hacks at Bitcamp. Our idea stems from\n" +
    "YOU+TECH, where Bitcampers are encouraged to take something they love and\n" +
    "infuse it with tech to make something awesome. Sponsors can often\n" +
    "influence hacks by giving tech talks in the beginning on their products\n" +
    "and by sponsoring a branded prize.</p>\n" +
    "<h3 id=\"bitcamper-demographics\">Bitcamper Demographics</h3>\n" +
    "<p>We already have Bitcampers signed up from around the country. Many have a\n" +
    "computer science or electrical engineering background. There will also be\n" +
    "a few high schoolers and masters students present. We are reaching out to\n" +
    "schools through Major League Hacking (mlh.io) and through our hackathon\n" +
    "contacts. It’s going to be a great turnout.</p>\n" +
    "<h3 id=\"bitcamp-provisions\">Bitcamp Provisions</h3>\n" +
    "<p>We’re doing it true camping style. There will be s’mores, sleeping bags,\n" +
    "fun side quests, stories around the bonfire (i.e., tech talks), a small\n" +
    "speaking stage, and lots of open space in the wilderness.</p>\n" +
    "<h3 id=\"parking\">Parking</h3>\n" +
    "<p>Parking will be complimentary for all sponsors. In order to give you\n" +
    "parking passes, we need to know the contact information and addresses for\n" +
    "drivers that will need the passes. This information is due to us by March\n" +
    "1, 2014. We will mail drivers parking passes when we receive your contact\n" +
    "information. We cannot guarantee parking passes for sponsors if\n" +
    "information is given to us after March 1, 2014.</p>\n" +
    "<h3 id=\"company-provisions\">Company Provisions</h3>\n" +
    "<ul>\n" +
    "<li><p>Sponsors will be camped in a ring around the main hacking space. Cole\n" +
    "Field House, our designating camping/hacking grounds, is essentially a\n" +
    "giant basketball stadium with a second level overlooking the main area.\n" +
    "There are breakout rooms lining the first floor. A more detailed map of\n" +
    "Cole Field House will be provided on the bitca.mp website in a few weeks.</p>\n" +
    "</li>\n" +
    "<li><p>We will provide tables, but we encourage sponsors to bring tableskirts,\n" +
    "banners, and anything else you may need. Prepare as though you are going\n" +
    "to a more fun, interactive career fair. A career fair where they feed you\n" +
    "s’mores.</p>\n" +
    "</li>\n" +
    "<li><p>Company swag: Companies are also encouraged to bring marketing materials\n" +
    "and company swag in the form of t-shirts, stickers, bags, pens,\n" +
    "sunglasses, water bottles, mints, cards, and other fun stuff. Bitcampers\n" +
    "love swag!</p>\n" +
    "</li>\n" +
    "<li><p>Prizes:  We find that students are most receptive to cash prizes. They\n" +
    "also like company offers of one-on-one mentorship, business advice, and\n" +
    "unique, in-kind offers—and it’s always fun to travel to company\n" +
    "headquarters!</p>\n" +
    "</li>\n" +
    "<li><p>Hotel Blocks: We are working to set up hotel blocks for non-local\n" +
    "employees interested in staying close to College Park. If your company\n" +
    "would like to book through our hotel block, please contact our Travel\n" +
    "Coordinator, Kunal Sharma, at <a href=\"mailto:ksharma8@terpmail.umd.edu\" title=\"Ask Kunal about travel\">ksharma8@terpmail.umd.edu</a>.</p>\n" +
    "</li>\n" +
    "</ul>\n" +
    "<h3 id=\"company-representatives\">Company Representatives</h3>\n" +
    "<p>We do not limit the number of mentors you may bring. We love mentors and\n" +
    "think they add value to Bitcamp through helping our Bitcampers succeed\n" +
    "in their hacks.  We would encourage you to bring at least one mentor. It\n" +
    "is best if mentors are willing to work with teams throughout the\n" +
    "hackathon. Please let us know by March 1st how many mentors you are\n" +
    "bringing and their areas of expertise that could help hackers.</p>\n" +
    "<h3 id=\"recruitment\">Recruitment</h3>\n" +
    "<p>If your sponsorship package includes recruitment privileges, then you may\n" +
    "bring recruiters to the event. If your sponsorship package does not\n" +
    "include recruitment, please do not bring recruiters.</p>\n" +
    "<h3 id=\"refund-policy\">Refund Policy</h3>\n" +
    "<p>If you find that you need a refund for funds already transferred, we\n" +
    "understand that sometimes things come up. Refunds will be given for\n" +
    "companies that send a written refund request to <a href=\"mailto:sponsorship@bitca.mp\" title=\"Send us an email!\">sponsorship@bitca.mp</a> by March 5. Unfortunately, due to Bitcamp’s spending\n" +
    "policy, we will not be able to provide refunds for committed funds\n" +
    "beyond that date.</p>\n" +
    "</div><div class=\"col-xs-12\"><h5 id=\"if-you-have-more-questions-feel-free-to-email-us-at-hello-bitca-mp-hello-\">If you have more questions, feel free to email us at <a href=\"mailto:hello@bitca.mp\" title=\"Send us an email!\">hello@bitca.mp</a>!</h5>\n" +
    "</div></div></div></div></div>"
  );


